import React from 'react'
import { BasketIcon } from '../assets'


export const Header = () => {
  return (
    <S>
        <h1>React Meals</h1>
        <button>
            {/* <Icon/> */}
            {/* <img src={basketIcon} alt="Basket" /> */}
            <BasketIcon/>
            <span>Your cart</span>
            <span>7</span>
        </button>
    </S>
  )
}
const StyledHeader = styled.header`
    	position: fixed;
	top: 0;
	left: 0;
	width: 100%;
	height: 5rem;
	color: white;
	background-color: #8a2b06;
	display: flex;
	justify-content: space-between;
	align-items: center;
	padding: 0 10%;
	box-shadow: 0 2px 8px rgba(0, 0, 0, 0.2);
	z-index: 10;
	& > h1 {
		font-size: 2.4rem;
		font-weight: 600;
	}

`
